import { FunctionComponent } from "react";

import { ReactComponent as Git } from "../../svg/github.svg";
import { ReactComponent as Twitter } from "../../svg/twitter.svg";
import { ReactComponent as Blog } from "../../svg/comment-regular.svg";
import { ReactComponent as About } from "../../svg/user-regular.svg";
import { ReactComponent as Projects } from "../../svg/code-solid.svg";
import { ReactComponent as Contact } from "../../svg/envelope-regular.svg";

import { IIconSquareProps } from "./types/interfaces";
import { EIconNames } from "../../interfaces/types";
import { IconButton } from "./styles/styled";

const IconSquare: FunctionComponent<IIconSquareProps> = ({ label, themeState }) => {
  return (
    <IconButton themeState={themeState}>
      {label === EIconNames.github ? <Git /> : null}
      {label === EIconNames.twitter ? <Twitter /> : null}
      {label === EIconNames.blog ? <Blog /> : null}
      {label === EIconNames.about ? <About /> : null}
      {label === EIconNames.projects ? <Projects /> : null}
      {label === EIconNames.contact ? <Contact /> : null}
    </IconButton>
  );
};

export default IconSquare;
